import React from "react"
import { NavLink, useLocation, useNavigate } from "react-router-dom"
import { authService } from "../../api/auth"
import "./Sidebar.css"

// –ò–∫–æ–Ω–∫–∏ –¥–ª—è –ø—É–Ω–∫—Ç–æ–≤ –º–µ–Ω—é (–∏—Å–ø–æ–ª—å–∑—É–µ–º Unicode-—Å–∏–º–≤–æ–ª—ã –¥–ª—è –ø—Ä–æ—Å—Ç–æ—Ç—ã)
const icons = {
  dashboard: "üìä",
  segment: "üîç",
  statistics: "üìà",
  distribution: "üìß",
  settings: "‚öôÔ∏è",
  admin: "üëë",
  logout: "üö™",
  questions: "‚ùì",
}

const Sidebar = ({ user }) => {
  const location = useLocation()
  const navigate = useNavigate()

  // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∞–∫—Ç–∏–≤–Ω—ã–π –ø—É–Ω–∫—Ç –º–µ–Ω—é –Ω–∞ –æ—Å–Ω–æ–≤–µ —Ç–µ–∫—É—â–µ–≥–æ –ø—É—Ç–∏
  const isActive = path => {
    if (path === "/dashboard" && location.pathname === "/dashboard") {
      return true
    }
    if (path !== "/dashboard" && location.pathname.startsWith(path)) {
      return true
    }
    return false
  }

  const handleLogout = () => {
    authService.logout()
    navigate("/login")
  }

  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <div className="sidebar-logo">ClientExp</div>
        <div className="sidebar-user">
          <div className="sidebar-user-avatar">
            {user?.username?.charAt(0).toUpperCase() || "U"}
          </div>
          <div className="sidebar-user-info">
            <div className="sidebar-user-name">
              {user?.username || "–ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å"}
            </div>
            <div className="sidebar-user-role">{user?.role || "–ú–µ–Ω–µ–¥–∂–µ—Ä"}</div>
          </div>
        </div>
      </div>

      <nav className="sidebar-nav">
        <NavLink
          to="/dashboard"
          className={`sidebar-nav-item ${
            isActive("/dashboard") ? "active" : ""
          }`}
        >
          <span className="sidebar-nav-icon">{icons.dashboard}</span>
          <span className="sidebar-nav-text">–ì–ª–∞–≤–Ω–∞—è</span>
        </NavLink>

        <NavLink
          to="/statistics"
          className={`sidebar-nav-item ${
            isActive("/statistics") ? "active" : ""
          }`}
        >
          <span className="sidebar-nav-icon">{icons.statistics}</span>
          <span className="sidebar-nav-text">–°—Ç–∞—Ç–∏—Å—Ç–∏–∫–∞</span>
        </NavLink>

        <NavLink
          to="/distribution"
          className={`sidebar-nav-item ${
            isActive("/distribution") ? "active" : ""
          }`}
        >
          <span className="sidebar-nav-icon">{icons.distribution}</span>
          <span className="sidebar-nav-text">–†–∞—Å—Å—ã–ª–∫–∏</span>
        </NavLink>

        {user && user.role === "ADMIN" && (
          <NavLink
            to="/admin"
            className={`sidebar-nav-item ${isActive("/admin") ? "active" : ""}`}
          >
            <span className="sidebar-nav-icon">{icons.admin}</span>
            <span className="sidebar-nav-text">–£–ø—Ä–∞–≤–ª–µ–Ω–∏–µ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è–º–∏</span>
          </NavLink>
        )}

        <NavLink
          to="/clients"
          className={`sidebar-nav-item ${isActive("/clients") ? "active" : ""}`}
        >
          <span className="sidebar-nav-icon">{icons.segment}</span>
          <span className="sidebar-nav-text">–°–µ–≥–º–µ–Ω—Ç—ã</span>
        </NavLink>

        <NavLink
          to="/questions"
          className={`sidebar-nav-item ${
            isActive("/questions") ? "active" : ""
          }`}
        >
          <span className="sidebar-nav-icon">{icons.questions}</span>
          <span className="sidebar-nav-text">–ë–∞–∑–∞ –≤–æ–ø—Ä–æ—Å–æ–≤</span>
        </NavLink>
      </nav>

      <div className="sidebar-footer">
        <NavLink
          to="/dashboard/settings"
          className={`sidebar-nav-item ${
            isActive("/dashboard/settings") ? "active" : ""
          }`}
        >
          <span className="sidebar-nav-icon">{icons.settings}</span>
          <span className="sidebar-nav-text">–ù–∞—Å—Ç—Ä–æ–π–∫–∏</span>
        </NavLink>

        <button className="sidebar-nav-item logout-item" onClick={handleLogout}>
          <span className="sidebar-nav-icon">{icons.logout}</span>
          <span className="sidebar-nav-text">–í—ã–π—Ç–∏</span>
        </button>
      </div>
    </div>
  )
}

export default Sidebar
